import React from "react";
import "./PerspectiveBox.sass";

const PerspectiveBox = () => {
  return (
    <div className="container_perspective_box">
      <div className="left">
        <div className="title_box"></div>
      </div>
      <div className="right">
        <div className="_pic_container"></div>
      </div>
    </div>
  );
};

export default PerspectiveBox;
